from tmmsoshiki
where comgyomu_kbn = #{comgyomuKbn,jdbcType=SMALLINT}
  and comten_cod = #{comtenCod,jdbcType=CHAR}
  and comsosknm11_knj = #{comsosknm11Knj,jdbcType=VARCHAR}
  and comtekiyostr_ymd = #{comtekiyostrYmd,jdbcType=DATE}

